import React, { Component } from "react";

export class ComedyDramaTV extends Component {
  render() {
    const api_key = "170638d59cd41f58852a2f12564d2503";
    const url = `https://api.themoviedb.org/3/tv/16420/similar?api_key=${api_key}&language=en-US&page=1`;
    return (
      <MovieCarousel apiUrl={url} title="International TV Comedy Dramas" />
    );
  }
}

export default ComedyDramaTV;
